Here’s a concise, standards‑based setup flow for Safari on iOS 16.4+ (Add to Home Screen web apps), using the current Push API documentation and Apple’s WebKit guidance.

**What iOS 16.4 requires (Apple‑specific)**
- Web Push on iOS/iPadOS 16.4 works only for web apps added to the Home Screen; it relies on Push API + Notifications API + Service Workers together. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/))
- The user must trigger the permission prompt via a direct interaction (e.g., a “Enable notifications” button). Permissions are managed per‑app in iOS Settings. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/))
- Web Push on iOS uses Apple Push Notification service (APNs); allow `*.push.apple.com` if you control push endpoints. No Apple Developer Program membership is required. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/))
- To behave like a Home Screen web app, serve a manifest with `display` set to `standalone` or `fullscreen`. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/))

**Core architecture (standards)**
- Push messages are delivered by a push service to your app’s service worker, even when the app isn’t active. ([w3c.github.io](https://w3c.github.io/push-api/))
- The Web Push protocol is standardized in RFC 8030. ([rfc-editor.org](https://www.rfc-editor.org/rfc/rfc8030))
- Application servers typically authenticate with VAPID (RFC 8292). ([rfc-editor.org](https://www.rfc-editor.org/info/rfc8292))
- Notifications are shown from a service worker via `showNotification()` on `ServiceWorkerRegistration`. ([notifications.spec.whatwg.org](https://notifications.spec.whatwg.org/))

---

**Setup steps**

1) Add a web app manifest and ensure the app is installed  
- Add a `manifest.json` with `display: "standalone"` or `display: "fullscreen"`. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/))  
- Instruct users to tap Share → “Add to Home Screen”.

2) Register a service worker and request permission on user gesture  
- The permission request must be inside a user‑initiated action. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/))

```js
// main.js (call from a click handler)
const reg = await navigator.serviceWorker.register('/sw.js');

const perm = await Notification.requestPermission(); // user gesture required
if (perm === 'granted') {
  const sub = await reg.pushManager.subscribe({
    userVisibleOnly: true,
    applicationServerKey: vapidPublicKey, // Uint8Array
  });
  await fetch('/api/push/subscribe', {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' },
    body: JSON.stringify(sub),
  });
}
```

3) Implement service worker push handling  
- Use `showNotification()` from the service worker registration. ([notifications.spec.whatwg.org](https://notifications.spec.whatwg.org/))

```js
// sw.js
self.addEventListener('push', (event) => {
  const data = event.data?.json() ?? {};
  event.waitUntil(
    self.registration.showNotification(data.title || 'Update', {
      body: data.body,
      data: { url: data.url },
    })
  );
});

self.addEventListener('notificationclick', (event) => {
  event.notification.close();
  event.waitUntil(clients.openWindow(event.notification.data?.url || '/'));
});
```

4) Server: store subscriptions and send pushes  
- Use the Web Push protocol (RFC 8030) to POST to the subscription endpoint. ([rfc-editor.org](https://www.rfc-editor.org/rfc/rfc8030))  
- Authenticate with VAPID (RFC 8292). ([rfc-editor.org](https://www.rfc-editor.org/info/rfc8292))  
- Ensure your server allows `*.push.apple.com` outbound if you restrict egress. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/))

---

**Quick iOS‑specific checklist**
- Installed as a Home Screen web app (not just a Safari tab). ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/))  
- Manifest `display: "standalone"` or `fullscreen`. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/))  
- Permission request on user action. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/))  
- APNs connectivity allowed (`*.push.apple.com`). ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/))  

